import { createBrowserRouter } from 'react-router-dom';
import AppLayout from '../components/Layout/AppLayout';
import Login from '../components/Page/Login';
import Register from '../components/Page/Register';
import Home from '../components/Page/Home';
import UserList from '../components/Crud/UserList';
import AddUser from '../components/Crud/AddUser';
import EditUser from '../components/Crud/EditUser';
import ErrorPage from '../components/Page/ErrorPage';

// Rute publik (tanpa AppLayout)
const publicRoutes = [
  {
    path: '/login',
    element: <Login />,
  },
  {
    path: '/register',
    element: <Register />,
  },
];

// Rute privat (dengan AppLayout)
const privateRoutes = [
  {
    element: <AppLayout />,
    children: [
      {
        path: '/',
        element: <Home />,
      },
      {
        path: '/user-list',
        element: <UserList />,
      },
      {
        path: '/add-user',
        element: <AddUser />,
      },
      {
        path: '/edit-user/:id',
        element: <EditUser />,
      },
    ],
  },
];

// Membuat router
export const router = createBrowserRouter([
  {
    element: <PublicRoutesMiddleware />,
    children: publicRoutes,
  },
  {
    element: <AuthRoutesMiddleware />,
    children: privateRoutes,
  },
  {
    path: '*',
    element: <ErrorPage />,
  },
]);
